body.script:
var availableSpace = $(window).height() - $('#detail-icon-img').offset().top - 256;

// Determine the optimal preview size, depending on the screen height
var optimalSize = $('.size-navigation .iconsize[data-action]').filter(function() {
    return $(this).data('iconsize') < availableSpace;
}).last().data('iconsize');

var sizedImage = $('.alticons[data-size="' + optimalSize + '"] img');

// Size the preview image
if( sizedImage ) {
    $('#detail-icon-img').attr({
        'src': sizedImage.attr('src'),
        'width': sizedImage.attr('width'),
        'height': sizedImage.attr('height')
    });
}

// Trigger the rest of the event on full page load
onLoadFunctions.push(function() {
    $('[data-iconsize="'+ optimalSize +'"]').trigger('click');
});

